import React from 'react';

import { BrowserRouter as Router, Route } from "react-router-dom";

const App = () => {
  return (
    <Router>
      <Route path="/" render={() => <h1>Welcome!</h1>} />
      <Route path="/about" render={() => <h1>Abouto!</h1>} />
      <Route path="/contact" render={() => <h1>Contacto!</h1>} />
    </Router>
  );
}

export default App;
